import React,{useState} from 'react'

const File2 = () => {
    const[count,setcount]=useState(1)
    const countin =()=>{
        setcount(count+1)
    }
  return (
    <><div>

    <h1 onClick={countin}>files:{count}</h1>
    </div></>
  )
}

export default File2
